import * as CommonStyles from '../../styles/common-styles';
import * as Universal from '../../../universal';
import React from 'react';
import ResponsiveTextField from '../../common-comps/ResponsiveTextField';
import ResponsiveText from '../../common-comps/ResponsiveText';

const TITLE_SIZE = 36;
const TEXT_FIELD_SIZE = 28;

export default class PersonalInfo extends React.Component<any, any> {
    constructor(props: any) {
        super(props);
    }

    textFieldContainer = () => {
        return {
            ...CommonStyles.FlexCC,
            padding: '1%'
        };
    };

    render = () => {
        return (
            <div>
                <ResponsiveText size={TITLE_SIZE}>Personal Information</ResponsiveText>
                <div>
                    <ResponsiveTextField
                        placeholder="First Name"
                        onChange={() => console.log('hi')}
                        size={TEXT_FIELD_SIZE}
                    ></ResponsiveTextField>
                </div>
                <div>
                    <ResponsiveTextField
                        placeholder="Last Name"
                        onChange={() => console.log('hi')}
                        size={TEXT_FIELD_SIZE}
                    ></ResponsiveTextField>
                </div>
                <div>
                    <ResponsiveTextField
                        placeholder="Grade Level"
                        onChange={() => console.log('hi')}
                        size={TEXT_FIELD_SIZE}
                    ></ResponsiveTextField>
                </div>
            </div>
        );
    };
}
